import React from 'react';
import './About.css'; // Import the CSS file

const About = () => {
  return (
    <div className="about-container">
      <h1>About Me</h1>
      <p>
        I am a Full Stack Developer with a passion for building scalable applications. 
        I have a background in Computer Science and Engineering, currently pursuing my 
        B.Tech at Dronacharya Group of Institutions, Greater Noida.
      </p>
      <p>
        My career objective is to work in a competitive environment to expand my knowledge 
        and enhance my professional skills while contributing to the growth of the company.
      </p>
    </div>
  );
};

export default About;
